import React from "react";

export default class EditToolbar extends React.Component {
    render() {
        const {closeCurrentListCallback, currentList} = this.props;
        if (currentList === null) {
            return (
                <div id="edit-toolbar">
                    <div 
                        id='undo-button' 
                        className="top5-button-disabled">
                            &#x21B6;
                    </div>
                    <div
                        id='redo-button'
                        className="top5-button-disabled">
                            &#x21B7;
                    </div>
                        <div
                        id='close-button'
                        className="top5-button-disabled"
                        onClick = {closeCurrentListCallback}>
                        &#x24E7;
                    </div>
                </div>
            )
        }
        else {
            if (this.jsTPS.hasTransactionToUndo()) {
                if (this.jsTPS.hasTransactionToRedo()){
                return(
                    <div id="edit-toolbar">
                        <div 
                            id='undo-button' 
                            className="top5-button">
                            &#x21B6;
                        </div>
                        <div
                            id='redo-button'
                            className="top5-button">
                                &#x21B7;
                    </div>
                    <div
                        id='close-button'
                        className="top5-button"
                        onClick = {closeCurrentListCallback}>
                        &#x24E7;
                    </div>
                </div>)
                }
                else {
                    return(
                        <div id="edit-toolbar">
                            <div 
                                id='undo-button' 
                                className="top5-button">
                                &#x21B6;
                            </div>
                            <div
                                id='redo-button'
                                className="top5-button-disabled">
                                    &#x21B7;
                        </div>
                        <div
                            id='close-button'
                            className="top5-button"
                            onClick = {closeCurrentListCallback}>
                            &#x24E7;
                        </div>
                    </div>)
                }
            }
            else {
                if (this.jsTPS.hasTransactionToRedo()){ 
                return(
                    <div id="edit-toolbar">
                        <div 
                            id='undo-button' 
                            className="top5-button-disabled">
                            &#x21B6;
                        </div>
                        <div
                            id='redo-button'
                            className="top5-button">
                                &#x21B7;
                    </div>
                    <div
                        id='close-button'
                        className="top5-button"
                        onClick = {closeCurrentListCallback}>
                        &#x24E7;
                    </div>
                </div>
            )
                }
                else {
                    return(
                        <div id="edit-toolbar">
                            <div 
                                id='undo-button' 
                                className="top5-button-disabled">
                                &#x21B6;
                            </div>
                            <div
                                id='redo-button'
                                className="top5-button-disabled">
                                    &#x21B7;
                        </div>
                        <div
                            id='close-button'
                            className="top5-button"
                            onClick = {closeCurrentListCallback}>
                            &#x24E7;
                        </div>
                    </div>
                )
                }
            }
        }
    }
}
